import React, { useState } from 'react';
import axios from 'axios';
import { TextField, Button, Typography, Container, Box } from '@mui/material';

const GenerateText = () => {
  const [start, setStart] = useState('');
  const [numSamples, setNumSamples] = useState(10);
  const [maxNewTokens, setMaxNewTokens] = useState(50);
  const [temperature, setTemperature] = useState(1.0);
  const [topK, setTopK] = useState(null);
  const [generatedText, setGeneratedText] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/generate', {
        start,
        num_samples: numSamples,
        max_new_tokens: maxNewTokens,
        temperature,
        top_k: topK,
      });
      setGeneratedText(response.data.generated_text);
    } catch (error) {
      console.error('Error:', error);
      setGeneratedText('Error generating text');
    }
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 4, mb: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Generate Text
        </Typography>
        <Typography variant="body1" gutterBottom>
          This model is trained on Shakespeare's text dataset.
        </Typography>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Enter start text"
            value={start}
            onChange={(e) => setStart(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Number of samples"
            type="number"
            value={numSamples}
            onChange={(e) => setNumSamples(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Max new tokens"
            type="number"
            value={maxNewTokens}
            onChange={(e) => setMaxNewTokens(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Temperature"
            type="number"
            value={temperature}
            onChange={(e) => setTemperature(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Top K"
            type="number"
            value={topK}
            onChange={(e) => setTopK(e.target.value)}
            fullWidth
            margin="normal"
          />
          <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
            Generate
          </Button>
        </form>
        {generatedText && (
          <Box sx={{ mt: 4 }}>
            <Typography variant="h6" component="h2">
              Generated Text
            </Typography>
            <Typography variant="body1" sx={{ whiteSpace: 'pre-wrap' }}>
              {generatedText}
            </Typography>
          </Box>
        )}
      </Box>
    </Container>
  );
};

export default GenerateText;
